import react from 'react';
import './style.css';

const Service=()=>{


    return (
        <>
        <div className="service_div">
           <div className="cards">
               <div className="card_img">
                    <img src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.herzing.edu%2Fbecome%2Fsoftware-engineer&psig=AOvVaw0bPG5845facT51_pCd_rB4&ust=1625220860217000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCPCg7cHVwfECFQAAAAAdAAAAABAD" />
                    
               </div>
           </div>
        </div> 
        </>
    )
}

export default Service;
